INSERT INTO `products` (`id`, `slug`, `name`, `sku`, `short_desc`, `long_desc`, `feature_img`, `gallery`, `category_id`, `discount`, `quantity`, `calculation_unit`, `weight`, `height`, `width`, `length`, `brand`, `status`, `meta_desc`, `meta_keyword`, `created_at`, `updated_at`) VALUES
(8, 'xzdqw', 'xzdqw', 'zcx', '<p><em><strong>Bộ sản phẩm trẻ h&oacute;a l&agrave;n da&nbsp;Daily Beauty Age Away Vitalizing hỗ trợ ngăn ngừa l&atilde;o ho&aacute;, duy tr&igrave; sự tươi trẻ.</strong></em></p>\r\n\r\n<p><strong>Quy c&aacute;ch:</strong> 4 sản phẩm/bộ</p>\r\n\r\n<p><strong>Xuất xứ:</strong> H&agrave;n Quốc</p>', '<p>Nếp nhăn xuất hiện l&agrave; dấu hiệu của t&igrave;nh trạng da bị l&atilde;o h&oacute;a, v&agrave; n&oacute; l&agrave; mối bận t&acirc;m h&agrave;ng đầu của chị em phụ nữ. Những dấu hiệu của l&atilde;o h&oacute;a xuất hiện sớm hay muộn phụ thuộc v&agrave;o những yếu tố như tiếp x&uacute;c qu&aacute; nhiều với &aacute;nh s&aacute;ng mặt trời hoặc m&ocirc;i trường khắc nghiệt, h&uacute;t thuốc l&aacute;, sử dụng một số loại thuốc, căng thẳng qu&aacute; mức, giảm c&acirc;n đột ngột, thiếu vitamin E, v&agrave; yếu tố di truyền&hellip;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" class=\"alignnone wp-image-4809\" src=\"https://rbvietnam.com/wp-content/uploads/2019/06/d26349b363219f7fc630.jpg\" style=\"height:690px; width:670px\" /></p>\r\n\r\n<p>Để duy tr&igrave; một vẻ đẹp trẻ trung, tươi s&aacute;ng th&igrave; b&ecirc;n cạnh việc c&oacute; một chế độ ăn uống, luyện tập hợp l&yacute; th&igrave; ch&uacute;ng ta cũng cần sử dụng kem dưỡng để bổ sung c&aacute;c dưỡng chất, duy tr&igrave; vẻ đẹp cho da.</p>\r\n\r\n<p>Ứng dụng c&ocirc;ng nghệ ti&ecirc;n tiến của H&agrave;n Quốc v&agrave; c&aacute;c th&agrave;nh phần từ thi&ecirc;n nhi&ecirc;n, bộ sản phẩm trẻ h&oacute;a l&agrave;n da&nbsp;Daily Beauty Age Away Vitalizing hỗ trợ ngăn ngừa l&atilde;o h&oacute;a, duy tr&igrave; sự tươi trẻ. Được chiết xuất từ c&aacute;c nguy&ecirc;n liệu thi&ecirc;n nhi&ecirc;n như: l&ocirc; hội, c&uacute;c la m&atilde;, quả oliu&hellip; l&agrave; những th&agrave;nh phần dưỡng da an to&agrave;n v&agrave; hiệu quả.</p>\r\n\r\n<h4>1. Nước hoa hồng Daily Beauty Age Away Vitalizing Toner</h4>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" class=\"alignnone size-full wp-image-4807\" src=\"https://rbvietnam.com/wp-content/uploads/2020/08/4237ea6ed5f329ad70e2.jpg\" style=\"height:1000px; width:736px\" /></p>\r\n\r\n<p>Nước hoa hồng Daily Beauty Age Away Vitalizing Toner l&agrave; một trong những loại nước hoa hồng c&oacute; khả năng thẩm thấu rất nhanh. Hỗ trợ c&acirc;n bằng độ pH tự nhi&ecirc;n tr&ecirc;n da, gi&uacute;p giữ ẩm. Hỗ trợ loại bỏ dầu thừa, c&oacute; thể se nhỏ lỗ ch&acirc;n l&ocirc;ng v&agrave; cho da mềm dịu.</p>\r\n\r\n<h4>2.&nbsp;Sữa dưỡng Daily Beauty Age Away Vitalizing Emulsion</h4>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" class=\"alignnone size-full wp-image-4805\" src=\"https://rbvietnam.com/wp-content/uploads/2020/08/b021df82f510094e5001.jpg\" style=\"height:1000px; width:700px\" /></p>\r\n\r\n<p>Sữa dưỡng Daily Beauty Age Away Vitalizing Emulsion thuộc d&ograve;ng sản phẩm t&aacute;i sinh, phục hồi da cao cấp với chất kem si&ecirc;u mềm mại. Sản phẩm cung cấp độ ẩm v&agrave; c&acirc;n bằng lượng dầu tự nhi&ecirc;n tr&ecirc;n da, hỗ trợ ngăn ngừa qu&aacute; tr&igrave;nh l&atilde;o h&oacute;a da, cho da mềm mại, mịn m&agrave;ng.</p>\r\n\r\n<h4>3.&nbsp;Kem dưỡng ban đ&ecirc;m Daily Beauty Age Away Vitalizing Night Cream</h4>\r\n\r\n<p>Sản phẩm với kết cấu mềm mịn c&oacute; khả năng thẩm thấu v&agrave;o da nhanh ch&oacute;ng m&agrave; kh&ocirc;ng g&acirc;y nhờn r&iacute;t hay bết d&iacute;nh.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" class=\"alignnone wp-image-4806\" src=\"https://rbvietnam.com/wp-content/uploads/2020/08/b37294c7ab5a57040e4b.jpg\" style=\"height:748px; width:698px\" /></p>\r\n\r\n<p>Kem dưỡng ban đ&ecirc;m Daily Beauty Age Away Vitalizing Night Cream hỗ trợ l&agrave;m trắng, nu&ocirc;i dưỡng da trong khi ngủ. Dưỡng ẩm cho l&agrave;n da, cho da mềm mại, s&aacute;ng mịn. Sản phẩm c&ograve;n c&oacute; khả năng hỗ trợ ph&ograve;ng ngừa l&atilde;o h&oacute;a da hiệu quả, hỗ trợ l&agrave;m mờ v&agrave; giảm c&aacute;c nếp nhăn, c&aacute;c vết th&acirc;m, n&aacute;m, t&agrave;n nhang do do qu&aacute; tr&igrave;nh l&atilde;o h&oacute;a da g&acirc;y ra.</p>\r\n\r\n<h4>4.&nbsp;Serum dưỡng da Daily Beauty Age Away Vitalizing Ampoule</h4>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" class=\"alignnone wp-image-4804\" src=\"https://rbvietnam.com/wp-content/uploads/2020/08/7796a17e8bec77b22efd.jpg\" style=\"height:826px; width:688px\" /></p>\r\n\r\n<p>Serum dưỡng da Daily Beauty Age Away Vitalizing Ampoule l&agrave; sản phẩm cuối c&ugrave;ng trong bộ sản phẩm trẻ h&oacute;a l&agrave;n da với c&ocirc;ng dụng hỗ trợ l&agrave;m giảm thiểu c&aacute;c dấu hiệu l&atilde;o h&oacute;a da, duy tr&igrave; sự tươi trẻ cho l&agrave;n da.</p>', 'http://localhost:85/appvuduc/storage/app/public/images/c1AtAxKMMxQAAAABJRU5ErkJggg%3D%3D.png', '', 9, NULL, NULL, 3, 10, 10, 10, 10, 1, 0, 'Orihiro Nattokinase với thành phần chính Nattokinase hàm lượng 2000FU/ngày, mang lại hiệu quả cao trong việc hỗ trợ điều trị và giảm thiểu nguy cơ tai biến.', 'Orihiro Nattokinase, tai biến, hỗ trợ tai biến', '2021-09-07 02:20:04', '2021-10-11 08:21:30'),
(10, 'hu-gao-93582680', 'Hu gao', 'HUGAO', '<p><em><strong>Bộ sản phẩm trẻ h&oacute;a l&agrave;n da&nbsp;Daily Beauty Age Away Vitalizing hỗ trợ ngăn ngừa l&atilde;o ho&aacute;, duy tr&igrave; sự tươi trẻ.</strong></em></p>\r\n\r\n<p><strong>Quy c&aacute;ch:</strong> 4 sản phẩm/bộ</p>\r\n\r\n<p><strong>Xuất xứ:</strong> H&agrave;n Quốc</p>', '<p>Nếp nhăn xuất hiện l&agrave; dấu hiệu của t&igrave;nh trạng da bị l&atilde;o h&oacute;a, v&agrave; n&oacute; l&agrave; mối bận t&acirc;m h&agrave;ng đầu của chị em phụ nữ. Những dấu hiệu của l&atilde;o h&oacute;a xuất hiện sớm hay muộn phụ thuộc v&agrave;o những yếu tố như tiếp x&uacute;c qu&aacute; nhiều với &aacute;nh s&aacute;ng mặt trời hoặc m&ocirc;i trường khắc nghiệt, h&uacute;t thuốc l&aacute;, sử dụng một số loại thuốc, căng thẳng qu&aacute; mức, giảm c&acirc;n đột ngột, thiếu vitamin E, v&agrave; yếu tố di truyền&hellip;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" class=\"alignnone wp-image-4809\" src=\"https://rbvietnam.com/wp-content/uploads/2019/06/d26349b363219f7fc630.jpg\" style=\"height:690px; width:670px\" /></p>\r\n\r\n<p>Để duy tr&igrave; một vẻ đẹp trẻ trung, tươi s&aacute;ng th&igrave; b&ecirc;n cạnh việc c&oacute; một chế độ ăn uống, luyện tập hợp l&yacute; th&igrave; ch&uacute;ng ta cũng cần sử dụng kem dưỡng để bổ sung c&aacute;c dưỡng chất, duy tr&igrave; vẻ đẹp cho da.</p>\r\n\r\n<p>Ứng dụng c&ocirc;ng nghệ ti&ecirc;n tiến của H&agrave;n Quốc v&agrave; c&aacute;c th&agrave;nh phần từ thi&ecirc;n nhi&ecirc;n, bộ sản phẩm trẻ h&oacute;a l&agrave;n da&nbsp;Daily Beauty Age Away Vitalizing hỗ trợ ngăn ngừa l&atilde;o h&oacute;a, duy tr&igrave; sự tươi trẻ. Được chiết xuất từ c&aacute;c nguy&ecirc;n liệu thi&ecirc;n nhi&ecirc;n như: l&ocirc; hội, c&uacute;c la m&atilde;, quả oliu&hellip; l&agrave; những th&agrave;nh phần dưỡng da an to&agrave;n v&agrave; hiệu quả.</p>\r\n\r\n<h4>1. Nước hoa hồng Daily Beauty Age Away Vitalizing Toner</h4>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" cl